import './ExpenseItem.css';
function ExpenseItem(){
    const expenseDate = new Date(2021, 6, 6);
    const expenseTitle = 'Renter Insurance';
    const expensePrice = 18.27;
    return(
        <div className="expense-item">
            <div>Date: {expenseDate.toDateString()}</div>
            <div className="expense-item__description">
                <h2>Title: {expenseTitle}</h2>
                <div className="expense-item__price">Amount: ${expensePrice}</div>
            </div>
        </div>
    );
}

export default ExpenseItem
